import React, { Component } from 'react';
import '../CssComponent/info.css'
class info extends Component {
    state = {}
    render() {
        return (
            <div className='container'>
               <div className='info'>
                   <img className='one logo' src='Premium.png' />
                   <div className='six expl'>
                    <h2>Premium Material</h2>

                   </div>
               </div>
            </div>
        );
    }
}

export default info;
